import React from 'react';
import _orderBy from 'lodash/sortBy';
import GameList from './components/GameList';
import GameForm from './components/GameForm';

const games = [
	{
		_id: 1,
		name: "Quadropolis",
		featured: true,
		thumbnail: "data:image/jpeg;base64,",
		price: 3299,
		players: "2-4",
		duration: 60

	},
	{
		_id: 2,
		name: "Roll for the galaxy",
		featured: false,
		thumbnail: "https://images-na.ssl-images-amazon.com/images/I/81LLUVpgb0L._SL1500_.jpg",
		price: 2999,
		players: "2-4",
		duration: 50

	},
	{
		_id: 3,
		name: "Five tribes",
		featured: false,
		thumbnail: "data:image/webp;base64,",
		price: 2999,
		players: "2-4",
		duration: 50

	}
];
const gamesNull = [];
const gamesUndefined = undefined;

class App extends React.Component {
	constructor(props){
		super(props);
		this.state = {
			games: []
		};
	}

	componentDidMount(){
		this.setState({
			games: this.sortGames(games)
		});
	}

	sortGames(games) {
		return _orderBy(games, ["featured", "name"], ["desc", "asc"])
	}

	toggleFeatured = (gameId) => {
		this.setState({
			games: this.sortGames(
				this.state.games.map(
					game =>
						gameId === game._id ? { ...game, featured: !game.featured } : game
				)
			)
		})
		// const newGames = this.state.games.map(game => {
		// 	if (game._id == gameId) return {...game, featured: !game.featured};
		// 	return game;
		// });
		// this.setState({
		// 	games: this.sortGames(newGames)
		// });
	}

	render() {
		return(
			<div className="ui container">
				<GameForm/>
				<br/>
				<GameList
					games={this.state.games}
					toggleFeatured={this.toggleFeatured}
				/>
			</div>
		)
	}
}

export default App;
